import React from 'react';

const HomePage = () => {
  return (
    <div>
      <center>
      <p>A dedicated resume website serves as a dynamic and versatile tool for professionals. It offers a centralized platform to present a comprehensive overview of skills, experiences, and achievements, allowing individuals to curate their personal brand effectively. This online presence is accessible to potential employers 24/7, transcending the limitations of traditional paper resumes. The website's interactive nature facilitates a deeper engagement, enabling the inclusion of multimedia elements like project showcases or video introductions, providing a richer context to one's professional story. Moreover, it enhances online visibility, optimizing searchability and discoverability in the digital landscape. In essence, a resume website is a strategic asset, offering a modern, tailored, and impactful representation of one's professional identity.</p>
      {/* Add more content as needed */}
      </center>
    </div>
  );
}

export default HomePage;
